import React from 'react'
import { Col } from 'antd'
import { Link } from 'react-router-dom'
export function show(list){
    if (list.length>0){
        let result=list.map(value=>{
            return(
                <Col span={6}>
                    <Link to={'/pokemon/'+value.id}>
                        <img src={value.img}></img>
                        <p>{value.id}</p>
                        <p>{value.name}</p>
                    </Link>
                </Col>
            )
        })
        return result
    }
}
